import { Component, OnInit } from '@angular/core';
import { QualificationsService } from '../qualifications.service';

@Component({
  selector: 'app-qualifications',
  templateUrl: './qualifications.component.html',
  styleUrls: ['./qualifications.component.css']
})
export class QualificationsComponent implements OnInit{
  qualisummary:any=[];
  quali:any=[];
  showdet=false;
  university:string="";
  startdate:number=0;
  enddate:number=0;
  showdeta=false;
  cgpa:number=0;
  selectedDetails:any="";
  selectedIndex:number=-1;
  in:number=-1;
constructor(public qualification:QualificationsService){
}
onhandle(index: number) {
  this.selectedIndex = index;
}
handlek(details: any,j:number) {
  this.selectedDetails = details;
  this.in=j;
}
ngOnInit(){
  this.qualisummary=this.qualification.getacademics();

  this.quali=[
    {
      type:"Education", Details:[ { first: 'Graduation', university: 'GMU', startdate: 2022, enddate: 2023, cgpa: 3.5 },
      { first: 'Undergraduation', university: 'SNIST', startdate: 2022, enddate: 2023, cgpa: 3.5 },
      { first: 'Schooling', university: 'School Name', startdate: 2010, enddate: 2020, cgpa: 'NA' }]
    },
    {
      type:"WorkExperience", Details:[{first:'Nuronics lab',second:'TCS',third:'GMU'}]
    },
  ];

}


}
<div class="container mt-5">
    <div *ngFor="let qualify of quali; let i=index">
      <button class="btn btn-primary" (click)="onhandle(i)">
        {{ qualify.type }}
      </button><br>

      <div class="mt" *ngIf="i === selectedIndex">
        <div *ngFor="let det of qualify.Details; let j=index" class="my-3" (click)="handlek(det, j)">
          <button class="btn btn-secondary">{{ det.first }}</button> 
          <button class="btn btn-secondary">{{ det.second }}</button><br>
          <button class="btn btn-secondary">{{ det.third }}</button><br>

          <div *ngIf="j === in" class="mt">
            <div *ngIf="selectedDetails" class="bg-light p-3">
              <p><strong>University:</strong> {{ selectedDetails.university }}</p>
              <p><strong>Start Date:</strong> {{ selectedDetails.startdate }}</p>
              <p><strong>End Date:</strong> {{ selectedDetails.enddate }}</p>
              <p><strong>CGPA:</strong> {{ selectedDetails.cgpa }}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
